const mobilePhones = [
    { name: 'Samsung Galaxy', id: 1 },
    { name: 'Nokia 3310', id: 2},
    { name: 'Blackberry XZ', id: 3}
];

function ShoppingList() {
    const smartphoneList =
        mobilePhones.map((smartphone) => {
            <li key={smartphone.id}>{smartphone.name}</li>
        });

    return <ul>{smartphoneList}</ul>;
}

export default ShoppingList;
